import { Link } from "react-router-dom";
import About from "./about";

function Home() {

    return (
      <headers>
        <a href="#" >logo</a>
        <nav>
            <ul>
                <li>
                    <Link>Home</Link>
                </li>
                <li>
                    <Link to={'/About'}>About</Link>
                    <a href="/About"/>
                </li>
                <li>
                    <Link to={'/contact'}>Contact</Link>
                    <a></a>
                </li>
            </ul>
        </nav>
      </headers>
    )
  }

  export default Home;
